import "./pages.css";

const Applications = () => {
  return (
    <div 
        style={{
            display: 'flex', 
            justifyContent:'center', 
            alignItems: 'center',
            height: '90vh'
        }}
    >
    <h2>Applications</h2>
    </div>
  )
}

export default Applications
